import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';

const initialState = {
    fullname: '',
    contact: '',
    email: '',
    password: '',
    role:''
}

const SignUp = () => {
    
    const [state, setState] = useState(initialState);

    const handleChange = (event) => { 
        const value = event.target.type === "checkbox" ? event.target.checked : event.target.value;
        setState({...state,[event.target.name]:event.target.value});
    }

    const handleSubmit = (event) => { 
        event.preventDefault();
        console.log("Form Data:", state);
        fetch("http://localhost:8080/owner/add", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(state)
        }).then(() => {
            console.log("New Entry done")
        }).catch(error=>console.error('Error occured: ',error));
    }
    useEffect(()=>{
        fetch("http://localhost:8080/owner/getAll")
        .then(res=>res.json())
        .then((state)=>{
          setState(state);
        }
      )
    }, [])
  
  return (
    <div className="bg-gray-100 h-screen flex items-center justify-center">
        <h2>Sign Up</h2>
        
        <form onSubmit={handleSubmit}>
          <div>Account Type:
            <input type="radio" id="isOwner" name="role" value="owner" checked={state.role === "owner"} onChange={handleChange}/>
            <label htmlFor="isOwner">Owner</label>
            <input type="radio" id="isBuyer" name="role" value="buyer" checked={state.role === "buyer"} onChange={handleChange}/>
            <label htmlFor="isbuyer">Buyer</label>
            <input type="radio" id="isAllie" name="role" value="allie" checked={state.role === "allie"} onChange={handleChange}/>
            <label htmlFor="isAllie">Allie</label>
          </div>

          <div>
            <label htmlFor="fullname">Fullname: </label>
            <input type="text" id="fullname" name="fullname" value={state.fullname} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="contact">Contact: </label>
            <input type="tel" id="contact" name="contact" value={state.contact} pattern="[0-9]{10}" onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="email">Email: </label>
            <input type="email" id="email" name="email" value={state.email} onChange={handleChange} />
          </div>
          <div>
            <label htmlFor="password">Password: </label>
            <input type="password" id="password" name="password" value={state.password} onChange={handleChange} />
          </div>
          
          <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded-md hover:bg-blue-600 focus:outline-none focus:ring focus:border-blue-500">Submit</button>
          <div>
                  <h2>Form data</h2>
                  <div>Full Name: {state.fullname}</div>
                  <div>Contact: {state.contact}</div>
                  <div>Email: {state.email}</div>
                  <div>Password: {state.password}</div>
                  <div>Role: {state.role }</div>
              </div>
        
        
        
        </form>

        <p className="mt-4 text-gray-600 text-sm">Already have an account? <Link to="/signin">Sign In</Link></p>
    </div>
  );
}

export default SignUp
